// src/pages/dashboard.jsx
import React, { useEffect, useState } from "react";
import { RiSearchLine, RiNotification3Line, RiUser3Line, RiLogoutBoxRLine } from "react-icons/ri";
import API, { setToken as setApiToken } from "../services/api";
import { useNavigate } from "react-router-dom";

/* small helpers */
const maskAccount = (acc) => {
  if (!acc) return "XXXX-XXXX-XXXX";
  const s = String(acc).replace(/\s+/g, "");
  return s.length <= 4 ? "****" : `XXXX-XXXX-${s.slice(-4)}`;
};
function StatusBadge({ status }) {
  const map = {
    Approved: "bg-green-100 text-green-800",
    Rejected: "bg-red-100 text-red-800",
    Started: "bg-yellow-50 text-yellow-800",
    Submitted: "bg-indigo-50 text-indigo-800",
    "Not Started": "bg-gray-100 text-gray-700",
  };
  const cls = map[status] || "bg-gray-100 text-gray-700";
  return <span className={`px-3 py-1 rounded-full text-sm font-semibold ${cls}`}>{status}</span>;
}

export default function Dashboard() {
  const navigate = useNavigate();
  const [user, setUser] = useState({
    name: "",
    email: "",
    mobile: "",
    kycId: "",
    kycStatus: "Not Started",
    accountNo: "",
    balance: null,
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // restore token/header if available
    const token = localStorage.getItem("token");
    if (token) {
      try { setApiToken(token); } catch (e) {}
    }

    // try fetch from backend; fallback to localStorage
    const fetchDashboard = async () => {
      try {
        const res = await API.get("/kyc/dashboard");
        const data = res.data || {};
        setUser({
          name: data.fullName || data.name || localStorage.getItem("userName") || "",
          email: data.email || localStorage.getItem("userEmail") || "",
          mobile: data.mobile || localStorage.getItem("userMobile") || "",
          kycId: data.kycId || localStorage.getItem("userKycId") || "N/A",
          kycStatus: data.status || (data.personal ? "Started" : "Not Started"),
          accountNo: data.accountNo || localStorage.getItem("userAccountNo") || "",
          balance: data.balance ?? null,
        });
      } catch (err) {
        // fallback to localStorage values if API call fails
        setUser({
          name: localStorage.getItem("userName") || "",
          email: localStorage.getItem("userEmail") || "",
          mobile: localStorage.getItem("userMobile") || "",
          kycId: localStorage.getItem("userKycId") || "N/A",
          kycStatus: localStorage.getItem("userKycStatus") || "Not Started",
          accountNo: localStorage.getItem("userAccountNo") || "",
          balance: null,
        });
        console.warn("dashboard fetch failed:", err?.response?.status || err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchDashboard();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("role");
    // optionally clear other user fields if stored
    // localStorage.removeItem("kycPersonal");
    try {
      navigate("/", { replace: true });
      setTimeout(() => { if (window.location.pathname !== "/") window.location.href = "/"; }, 120);
    } catch {
      window.location.href = "/";
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* TOP NAVBAR */}
      <header className="w-full bg-[#0047B3] text-white shadow-md py-3 px-6 flex items-center justify-between">
        <div>
          <div className="text-xs">Welcome back</div>
          <div className="text-lg font-semibold">{user.name || "Customer"}</div>
        </div>
        <div className="flex items-center gap-4">
          <div className="relative">
            <input
              type="text"
              placeholder="Search banking services..."
              className="py-2 pl-3 pr-10 rounded-md text-black w-64"
            />
            <RiSearchLine size={20} className="absolute top-2.5 right-3 text-gray-600" />
          </div>
          <RiNotification3Line size={22} className="cursor-pointer" />
          <RiUser3Line size={22} className="cursor-pointer" />
          <button onClick={handleLogout} title="Logout" className="ml-2 p-2 bg-white rounded text-[#d33]"><RiLogoutBoxRLine /></button>
        </div>
      </header>

      <main className="max-w-7xl mx-auto px-6 py-8">
        {/* user / kyc card */}
        <section className="bg-white rounded-lg shadow-md p-6 mb-8 border border-gray-200">
          <div className="flex justify-between items-start gap-6">
            <div className="w-2/3">
              <h3 className="text-lg font-semibold mb-2">KYC Details</h3>
              <div className="text-sm text-gray-600 mb-1"><span className="font-medium">KYC Status:</span> <StatusBadge status={user.kycStatus} /></div>
              <div className="text-sm text-gray-700"><span className="font-medium">Name:</span> {user.name || "—"}</div>
              <div className="text-sm text-gray-700"><span className="font-medium">Mobile:</span> {user.mobile || "—"}</div>
            </div>

            <div className="w-1/3 text-right">
              <div className="text-sm text-gray-600"><span className="font-medium">KYC ID:</span> {user.kycId || "N/A"}</div>
              <div className="text-sm text-gray-700 mt-4"><span className="font-medium">Email:</span> {user.email || "—"}</div>
              <div className="text-sm text-gray-700 mt-2"><span className="font-medium">Account No:</span> {maskAccount(user.accountNo)}</div>
            </div>
          </div>
        </section>

        {/* primary account */}
        <section className="bg-white rounded-lg shadow-md p-6 mb-8 border border-gray-200">
          <h4 className="text-sm text-gray-500">Primary Account</h4>
          <div className="text-3xl font-bold mt-2 text-gray-900">₹ {user.balance !== null ? user.balance.toLocaleString() : "—"}</div>
          <div className="text-sm text-gray-500">Available Balance</div>

          <div className="flex gap-4 mt-6">
            <button className="bg-[#0047B3] text-white px-6 py-2 rounded-md hover:bg-[#003f9e] transition">Transfer</button>
            <button className="border border-gray-300 px-6 py-2 rounded-md hover:bg-gray-100 transition">Statement</button>
          </div>
        </section>

        {/* services grid */}
        <section>
          <h3 className="text-lg font-semibold mb-4 text-gray-700">Banking Services</h3>

          <div className="grid grid-cols-2 sm:grid-cols-3 lg:grid-cols-4 gap-6">
            {["Accounts","Deposits","Loans","Investments","Insurance","Cards","Payments","UPI & QR"].map((title) => (
              <div key={title} className="bg-white border border-gray-200 shadow-sm hover:shadow-md transition rounded-lg p-6 flex flex-col items-center text-center cursor-pointer">
                <div className="text-[#0047B3] mb-3" style={{ fontSize: "26px" }}>{/* placeholder icon circle */}<div className="w-8 h-8 rounded bg-[#e9f1ff]" /></div>
                <div className="font-semibold text-gray-800">{title}</div>
              </div>
            ))}
          </div>
        </section>
      </main>
    </div>
  );
}
